    render() { 


        return (
            <Div 
                d="flex" 
                justify="center" 
                align="center" 
                minH="100vh" 
                w="100vw" 
                flexDir="column"
            >
                <Text 
                    textSize="display2" 
                    textWeight="600"
                    textAlign="center"
                    m={{ b: "1.5rem" }}
                >
                Welcome to Dumb Donuts
                </Text>
            </Div>
            )
    }
}

export default Connect;
